import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import App from './App';
import CreateMocion from './components/CreateMocion';
import EditMocion from './components/EditMocion';
import ViewMocion from './components/ViewMocion';

ReactDOM.render(
    <Router>
        <Switch>
            <Route exact path="/" component={App} />
            <Route path="/crear" component={CreateMocion} />
            <Route path="/editar/:id" component={EditMocion} />
            <Route path="/ver/:id" component={ViewMocion} />
        </Switch>
    </Router>,
    document.getElementById('root')
);
